import './index.css'; 
import Profile from '../profile/Profile';
import Calendar from '../../card/calendar/Calendar';
import TerrainButton from '../../elements/button/TerrainButton';

const LeftNav = () => (
  <div className="navleft">
    <Profile/>
    <Calendar/>

    <div className="greet" >
        <div className="title">Terrains à valider</div>
        <div className="subtitle">validez la création de vos terrain</div>
    </div>
    <ul className='ul-leftnav'>
        <li>
            <TerrainButton/>
        </li>
        <li>
            <TerrainButton/>
        </li>
        <li>
            <TerrainButton/>
        </li>
    </ul>
  </div> 
);

export default LeftNav;
